#
# TABLE STRUCTURE FOR: ETinfo
#

DROP TABLE IF EXISTS `ETinfo`;

CREATE TABLE `ETinfo` (
  `ETinfoID` int(11) NOT NULL AUTO_INCREMENT,
  `First` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `Last` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `EntertainerName` varchar(100) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `address` varchar(100) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `City` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `State` varchar(25) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `Zip` varchar(5) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `email` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `phone` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `Description` text COLLATE utf8_unicode_ci DEFAULT NULL,
  `ETID` int(11) DEFAULT NULL,
  `imgURL` varchar(2000) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`ETinfoID`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `ETID` (`ETID`),
  CONSTRAINT `ETinfo_ibfk_1` FOREIGN KEY (`ETID`) REFERENCES `loginET` (`ETID`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



